import ProjectForm from '../components/ProjectForm';
import ProjectList from '../components/ProjectList';
import TaskForm from '../components/TaskForm';
import TaskList from '../components/TaskList';

const Projects = () => {
  return (
    <div>
      <h2>Projects</h2>
      <ProjectForm />
      <ProjectList />
      <TaskForm />
      <TaskList />
    </div>
  );
};

export default Projects;
